  input: '"TEXT","F3XA",,"Re:  Your letter dated 4/3/02.  The Schedule A receipts
    are from an annual joint fundraising event.  The joint fundraising committee''s
    re receipts were less than the expenditures it had to make for 2001.  As a result,
    no money was disbursed from the joint fundaising committee to the joint fundraiser
    participants.  With regard to the PAC''s administrative expenses, the PAC retains
    Williams & Jensen to administer the PAC''s activities, including receipts, disbursments,
    preparing the FEC reports and acting as custodian of the PAC''s records.  The
    PAC pays the firm a monthly fee, which includes those administrative expenses
    to which you refer in your letter, such as rent, utilities, office equipment,
    etc.  The PAC has one employee who is paid monthly, and that expense is reported
    as required."'
